export const styles = {
  wrapper: {
    display: "flex",
    justifyContent: "flex-end",
    alignItems: "center",
    cursor: "pointer"
  },

  name: {
    color: "#fff",
    fontSize: 14,
    textTransform: "uppercase",
    marginBottom: 0,
    marginRight: 20
  },

  icon: {
    fontSize: 24,
    color: "#fff"
  }
};
